---
insecure: true
import-paths:
- "/home/user/pb/grpcbin"
proto: grpcbin.proto
call: grpcbin.GRPCBin.DummyUnary
host: 127.0.0.1:9000
duration: 20s
max-duration: 60s
stream-interval: 25s
timeout: 30s
max-recv-message-size: "1024mb"
max-send-message-size: "2000mib"
data:
  f_strings:
  - '123'
  - '456'
